import React from "react";
import { Stack, Box } from "@mui/material";
import { VideoCard } from "./";


function transformPath(path) {
  // Replace the file extension with ".png"
  return path.replace(/\.mp4$/, '.png');
}

const Videos = (props) => {
  console.log("these are the props", props.videos);

  // Reverse the array to display videos in a Last In, First Out (LIFO) order
  const reversedVideos = [...props.videos].reverse();

  return (
    <Stack
      direction={"row"}
      flexWrap="wrap"
      justifyContent="start"
      alignItems="start"
      gap={2}
    >
      {reversedVideos.map((item, idx) => (
        <Box key={idx}>
          {
            <VideoCard
              id={item.id}
              path={item.video_path}
              channelTitle={item.title}
              title={item.title}
              image="https://upload.wikimedia.org/wikipedia/commons/thumb/4/49/A_black_image.jpg/640px-A_black_image.jpg"
            />
          }
        </Box>
      ))}
    </Stack>
  );
};

export default Videos;
